import React from "react";
import PropTypes from "prop-types";
// @material-ui/core components
import { makeStyles } from "@material-ui/core/styles";
// core components
import GridItem from "../../components/Grid/GridItem";
import GridContainer from "../../components/Grid/GridContainer";
import Table from "../../components/Table/Table";
import Table3 from "../../components/Table/Table3";
import Card from "../../components/Card/Card";
import CardHeader from "../../components/Card/CardHeader";
import CardBody from "../../components/Card/CardBody";
//variaveis
import { dataTab } from '../../variables/tables/data'

import styles from '../../assets/jss/material-dashboard-react/views/dashboardStyle'

const useStyles = makeStyles(styles);

export default function TableList() {
  const classes = useStyles();

  return (
    <div>
      <GridContainer>
        <GridItem xs={12} sm={12} md={12}>
          <CardHeader >
            <h3></h3>
            <CustomTabs
              title=""
              headerColor="primary"
              tabs={[
                {
                  tabName: "Tabela",
                  tabIcon: Assignment,
                  tabContent: (
                    <Card>
                      <CardHeader color="warning">
                        <div>
                          <h3 className={classes.cardTitleWhite}>Relátório de imóveis a venda em Cascavel-PR</h3>
                          <p className={classes.cardCategoryWhite}>
                            Novos apartamentos em Julho de 2020</p>
                        </div>
                      </CardHeader>
                      <CardBody>
                        <Table3>teste</Table3>
                      </CardBody>
                    </Card>
                  )
                },
                {
                  tabName: "website",
                  tabIcon: Code,
                  tabContent: (
                    <Tasks
                      checkedIndexes={[0]}
                      tasksIndexes={[0, 1]}
                      tasks={website}
                    />
                  )
                },
                {
                  tabName: "server",
                  tabIcon: Cloud,
                  tabContent: (
                    <Tasks
                      checkedIndexes={[1]}
                      tasksIndexes={[0, 1, 2]}
                      tasks={server}
                    />
                  )
                }
              ]}
            />
          </CardHeader>
        </GridItem>

        <GridItem xs={12} sm={12} md={12}>
          <Card>
            <CardHeader color="warning">
              <div>
                <h3 className={classes.cardTitleWhite}>Relátório de imóveis a venda em Cascavel-PR</h3>
                <p className={classes.cardCategoryWhite}>
                  Novos apartamentos em Julho de 2020</p>
              </div>
            </CardHeader>
            <CardBody>
              <Table
                tableHeaderColor="warning"
                tableHead={["ID", "Nome", "Preço", "Área Útil", "Valor/m2", "Bairro", "Link"]}
                tableData={dataTab}
              />
            </CardBody>
          </Card>
        </GridItem>
      </GridContainer>
    </div>
  );
}
